import React, { useState, useEffect } from 'react';
import { useParams, useNavigate, Link } from 'react-router-dom';
import { getEstate } from '../../services/EstateService';

const EstateDetails = () => {
  const { id } = useParams();
  const navigate = useNavigate();
  const [estate, setEstate] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    const fetchEstate = async () => {
      try {
        const data = await getEstate(id);
        setEstate(data);
      } catch (err) {
        setError(err.message);
      } finally {
        setLoading(false);
      }
    };

    fetchEstate();
  }, [id]);

  if (loading) return <div className="text-center py-8">Загрузка...</div>;
  if (error) return <div className="text-center py-8 text-red-600">{error}</div>;
  if (!estate) return <div className="text-center py-8">Объект не найден</div>;

  return (
    <div className="max-w-4xl mx-auto py-8 px-4">
      <div className="flex justify-between items-center mb-6">
        <h1 className="text-2xl font-bold">Объект #{estate.id}</h1>
        <div className="space-x-2">
          <Link
            to={`/employee/dashboard/estates/edit/${estate.id}`}
            className="bg-blue-600 hover:bg-blue-700 text-white px-4 py-2 rounded"
          >
            Редактировать
          </Link>
          <button
            onClick={() => navigate(-1)}
            className="bg-gray-500 hover:bg-gray-600 text-white px-4 py-2 rounded"
          >
            Назад
          </button>
        </div>
      </div>

      <div className="bg-white rounded-lg shadow p-6 mb-6">
        <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
          <div>
            <h2 className="text-xl font-semibold mb-4">Основная информация</h2>
            <div className="space-y-3">
              <div>
                <p className="font-medium">Район:</p>
                <p>{estate.district}</p>
              </div>
              <div>
                <p className="font-medium">Комнат:</p>
                <p>{estate.rooms}</p>
              </div>
              <div>
                <p className="font-medium">Год постройки:</p>
                <p>{estate.construction_year}</p>
              </div>
            </div>
          </div>

          <div>
            <h2 className="text-xl font-semibold mb-4">Характеристики</h2>
            <div className="space-y-3">
              <div>
                <p className="font-medium">Площадь:</p>
                <p>{estate.total_area} м²</p>
              </div>
              <div>
                <p className="font-medium">Этажность дома:</p>
                <p>{estate.building_floors}</p>
              </div>
              <div>
                <p className="font-medium">Цена:</p>
                <p>{estate.cost ? `${estate.cost} ₽` : 'Не указана'}</p>
              </div>
            </div>
          </div>
        </div>

        {estate.description && (
          <div className="mt-6">
            <h2 className="text-xl font-semibold mb-2">Описание</h2>
            <p className="whitespace-pre-line bg-gray-50 p-3 rounded">
              {estate.description}
            </p>
          </div>
        )}

        <div className="mt-6">
          <h2 className="text-xl font-semibold mb-2">Владелец</h2>
          <p>
            {estate.first_name} {estate.last_name}
          </p>
        </div>
      </div>
    </div>
  );
};

export default EstateDetails;
